printed_text:
Bedrohlich
Immer wenn die Schreckensballista angreift, kannst du eine andere Kreatur opfern. Wenn du dies tust, zerstöre eine Kreatur deiner Wahl, die ein Gegner kontrolliert.
Exhumieren {3}{B}{B}

Menace
À chaque fois que la Baliste terrifiante attaque, vous pouvez sacrifier une autre créature. Quand vous faites ainsi, détruisez une créature ciblée qu'un adversaire contrôle.
Exhumation {3}{B}{B}

威慑
每当骇人巨弩攻击时，你可以牺牲另一个生物。当你如此作时，消灭目标由对手操控的生物。
破坟{3}{B}{B}

威迫
恐怖のバリスタが攻撃するたび、あなたはこれでないクリーチャー１体を生け贄に捧げてもよい。そうしたとき、対戦相手がコントロールしているクリーチャー１体を対象とする。それを破壊する。
蘇生{3}{B}{B}

飞行
{R}：由你操控的神器生物得+1/+0直到回合结束。
破坟{3}{R}{R}

Fliegend
{R}: Artefaktkreaturen, die du kontrollierst, erhalten +1/+0 bis zum Ende des Zuges.
Exhumieren {3}{R}{R}

飛行
{R}：ターン終了時まで、あなたがコントロールしているすべてのアーティファクト・クリーチャーは＋１/＋０の修整を受ける。
蘇生{3}{R}{R}

Vol
{R} : Les créatures-artefacts que vous contrôlez gagnent +1/+0 jusqu'à la fin du tour.
Exhumation {3}{R}{R}

森呼び自動機械が戦場に出たとき、あなたがこれを唱えていた場合、あなたがコントロールしている土地１つを対象とする。それをアンタップする。それは速攻を持ち基本のパワーとタフネスが森呼び自動機械のパワーとタフネスに等しいツリーフォーク・クリーチャーになる。それは土地でもある。
//PRT-Prototype_Mech//
{2}{G}{G}
試作（あなたはこの呪文を、異なるマナ・コスト、色、サイズで唱えてもよい。これは能力とタイプを保持する。）
３/３

Quand l'Automate parlebois arrive sur le champ de bataille, si vous l'avez lancé, dégagez un terrain ciblé que vous contrôlez. Il devient une créature Sylvin avec la célérité et avec une force et une endurance de base égales à la force et à l'endurance de l'Automate parlebois. C'est toujours un terrain.
//PRT-Prototype_Mech//
{2}{G}{G}
Prototype (Vous pouvez lancer ce sort avec un coût de mana, une couleur et une taille différents. Il garde ses capacités et ses types.)
3/3

当召木机械兽进战场时，若它经你施放，则重置目标由你操控的地。它成为树妖生物，具敏捷异能，且基础力量与防御力等同于召木机械兽的力量和防御力。它仍然是地。
//PRT-Prototype_Mech//
{2}{G}{G}
试作（你施放此咒语时可选不同法术力费用、颜色和攻防的版本，其异能与类别不变。）
3/3

Wenn der Holzrufer-Automat ins Spiel kommt und falls du ihn gewirkt hast, enttappe ein Land deiner Wahl, das du kontrollierst. Es wird zu einer Baumhirte-Kreatur mit Eile und Basis-Stärke und -Widerstandskraft in Höhe der Stärke und Widerstandskraft des Holzrufer-Automaten. Es ist immer noch ein Land.
//PRT-Prototype_Mech//
